import React from 'react';
import Styles from './Cards.module.css';
import Loader from '../Spinner';
const Cards = ({data}) => {
	return (
		<div>
			<h1 className={Styles.h1}>{data.confirmed === undefined ? <Loader /> : data.confirmed.value}</h1>
		</div>
	);
};

export default Cards;
